const OneFriend=(props)=>{


//console.log('contact: ',props.contact);

console.log('contact: ', props.contact.profile_image);


let imageurl = `${props.contact.profile_image}`



return (


<div className={classes.oneFriend}>
  {
  <img src={imageurl}  className={classes.friendImage} />	
  }
  <div className={classes.InfoBox}> 
	<i className={classes.fullName}> {props.contact.firstname +" "}{ props.contact.lastname}</i> 
	<button type='button' className={classes.addContactButton}>Add contact  </button>
  </div>

</div>
);


}

export default OneFriend;
